import React from "react";
import Container from "./Container";
import Style from "./Style";

const Home = () => {
  return (
    <Container>
      <Style><div className="body">
        <h1>О нас</h1>
        <div className="d-flex">
          <p className="">Главная</p>
          <hr />
          <p>О нас</p>
        </div>
      </div></Style>
    </Container>
  );
};

export default Home;
